import { Button } from "@mui/material"

import React from "react"
export interface IProps{
    id:string,
    name:string,
    staff:string,
    client:string,
    statusId:boolean

}
const ProjectList : React.FC<{onProps:IProps[]}>=(props)=>{
return (
    <ul>
    <div>{props.onProps.map((item:any, index)=>{
        
    return  `<li key={index}>
        ${item.name}  ${item.staff}    ${item.client} ${item.statusId} ${<Button >משימות</Button>}
        

          
          
</li>`
    })}</div>
    </ul>
)
}

export default ProjectList
